import { useState } from "react";
import api from "../api";


const SubsComponent = () => {

    const [subData, setSubData] = useState([]);

    api.get('/user/active-subs').then(response => {
        setSubData(response)
        console.log(response.data);

    });


    return (
        <div>
            <p>Active subs</p>
            {subData.map(subs => (
                <div key={subs.id}>
                  <div> {subs.plan_id} </div> 
                    </div>
              

            ))}
           

        </div>
    )
}


export default SubsComponent;
